export default class BookStoreService {

    data = [{
        id: 1,
        title: 'JavaScript: The Definitive Guide: Master the World\'s Most-Used Programming',
        author: "David Flanagan",
        imageUrl: "data:image/webp;base64,",
        price: 32
    }, {
        id: 2,
        title: "Eloquent JavaScript, 3rd Edition: A Modern Introduction to Programming",
        author: "Marijn Haverbeke",
        imageUrl: "data:image/webp;base64,",
        price: 29
    }
    ]

    getBooks() {
        return new Promise((resolve, reject) => {
            setTimeout(() => {
                let errorChance = Math.random();
                if (errorChance > 0.9) {
                    reject(new Error('Something went wrong!'))
                } else {
                    resolve(this.data)
                }
            }, 1000)
        });
    }
}
